var ApiTemplate2 = `;let contasiner = document.createElement("div")
    contasiner.className = 'contasiner'
    for(let row of objList){
        let line = document.createElement('div')
        line.className = 'line'
        let method = document.createElement('div')
        method.className = 'method'
        method.innerText = row.Method
        let url = document.createElement('div')
        url.className = 'url'
        url.innerText = row.URL
        let description = document.createElement('div')
        description.className = 'description'
        description.innerText = row.Description
        let location = document.createElement('div')
        location.className = 'location'
        location.innerText = row.Location
        let param = document.createElement('div')
        param.className = 'param'
        param.innerText = row.Param.length == 0? "no url param!" : row.Param.toLocaleString()
        line.appendChild(method)
        line.appendChild(url)
        line.appendChild(param)
        line.appendChild(description)
        line.appendChild(location)
        contasiner.appendChild(line)
    }
    document.getElementsByTagName('body')[0].appendChild(contasiner)
</script>	
</body>
</html>`

